import React from "react";
import Button from "@material-ui/core/Button";
import Dialog from "@material-ui/core/Dialog";
import DialogActions from "@material-ui/core/DialogActions";
import DialogContent from "@material-ui/core/DialogContent";
import Divider from "@material-ui/core/Divider";
import DialogContentText from "@material-ui/core/DialogContentText";
import Grid from "@material-ui/core/Grid";
import { GoogleLogin } from "react-google-login";
import "./LoginSignupDialog.css";

export default function LoginSignupDialog(props) {
  const responseGoogle = response => {
    console.log(response);
  };
  return (
    <div>
      <Dialog
        open={props.isActive}
        onClose={props.closeDialog}
        aria-labelledby="alert-dialog-title"
        aria-describedby="alert-dialog-description"
      >
        <Grid container justify="center" spacing={2}>
          <Grid item xs={12}>
            <img style={{ width: "100%" }} src="/banner.png"></img>
          </Grid>
          <Grid item xs={6}>
            <GoogleLogin
              style="width:100% !important"
              clientId="658977310896-knrl3gka66fldh83dao2rhgbblmd4un9.apps.googleusercontent.com"
              buttonText="Google ile kayÄ±t ol"
              style={{ width: "100% !impotant" }}
              onSuccess={responseGoogle}
              onFailure={responseGoogle}
              cookiePolicy={"single_host_origin"}
            />
          </Grid>
          <Grid item xs={12}>
            <Grid
              container
              direction="row"
              justify="center"
              alignItems="center"
            >
              <Grid item xs={4}>
                {" "}
                <Divider />
              </Grid>
              <Grid item xs={4}>
                <Box textAlign="center" m={1}>
                  Center aligned text.
                </Box>
              </Grid>
              <Grid item xs={4}>
                {" "}
                <Divider />
              </Grid>
            </Grid>
          </Grid>
        </Grid>

        <DialogContent>
          <DialogContentText id="alert-dialog-description">
            Let Google help apps determine location. This means sending
            anonymous location data to Google, even when no apps are running.
          </DialogContentText>
        </DialogContent>
        <DialogActions>
          <Button onClick={props.closeDialog} color="primary">
            Disagree
          </Button>
          <Button onClick={props.closeDialog} color="primary" autoFocus>
            Agree
          </Button>
        </DialogActions>
      </Dialog>
    </div>
  );
}
